@LabsAssistant 
Test of the main chain is live. Please do `./stop.sh` `./start.sh` to remove CFEKULTRADEAD and start notarizing LABSTH and start getting paid. 😃 
The airdrop was done, please check it was valid. Treat this chain as you would the real launch, ie, please mine and stake it like it has value. It will only last a few daysor a week to make 100% sure coin emission is correct.  For now there are no chains in its cluster. We will add those later, once this is confirmed to be working.
